Actionscript.script:
手枪射击许可 = false;
手枪2射击许可 = false;
if (_parent.手枪属性.power)
{
	手枪射击许可 = true;
	射击速度 = _parent.手枪属性.interval;
	弹夹容量 = _parent.手枪属性.capacity;
	使用弹夹名称 = _parent.手枪属性.clipname;
	声音 = _parent.手枪属性.sound;
	霰弹值 = _parent.手枪属性.split;
	子弹散射度 = _parent.手枪属性.diffusion;
	发射效果 = _parent.手枪属性.muzzle;
	子弹种类 = _parent.手枪属性.bullet;
	子弹威力 = _parent.手枪属性.power + 20;
	if (_parent.短枪额外攻击加成倍率)
	{
		子弹威力 += _parent.手枪属性.power * _parent.短枪额外攻击加成倍率;
	}
	子弹速度 = _parent.手枪属性.velocity;
	击中地图效果 = _parent.手枪属性.bullethit;
	Z轴攻击范围 = _parent.手枪属性.bulletsize + 20;
	击倒率 = _parent.手枪属性.impact / 2;
	击中后子弹的效果 = _parent.手枪属性.targethit;

	//手枪射击间隔帧 = Math.floor(射击速度 * 30 / 1000);
	手枪射击间隔帧 =Math.floor((射击速度 + 20) * 0.7 * 30 / 1000);
	//弹夹容量的最大射击间隔帧 = Math.floor(21 / (弹夹容量 - _parent.手枪.value.shot + 弹夹容量));
	手枪射击间隔帧 = Math.max(手枪射击间隔帧, 1);
	单发弹数  = 1;
	if(手枪射击间隔帧<= 3 && 子弹种类.indexOf("横向") == -1){
		原始霰弹值 = 霰弹值;
		霰弹值 *= Math.ceil(5/手枪射击间隔帧);
		if(子弹种类.indexOf("纵向") == -1){
			子弹种类 = "纵向联弹-" + 子弹种类;
			弹夹容量 = Math.floor(弹夹容量/霰弹值);
		}else{
			弹夹容量 = Math.floor(弹夹容量 * 原始霰弹值/霰弹值);
		}
		手枪射击间隔帧 = 5;
	}
}


