子弹敌我属性 = _parent.是否为敌人 == true ? false : true;

function 手枪换弹()
{
	手枪射击许可 = false;
	if (_parent._name == _root.控制目标)
	{
		if (_root.singleSubmit(使用弹夹名称, 1))
		{
			_parent.手枪.value.shot = 0;
			手枪射击许可 = true;
		}
	}
	else
	{
		_parent.手枪.value.shot = 0;
		手枪射击许可 = true;
	}
}
function 手枪2换弹()
{
	手枪2射击许可 = false;
	if (_parent._name == _root.控制目标)
	{
		if (_root.singleSubmit(使用弹夹名称_2, 1))
		{
			_parent.手枪2.value.shot = 0;
			手枪2射击许可 = true;
		}
	}
	else
	{
		_parent.手枪2.value.shot = 0;
		手枪2射击许可 = true;
	}
}

if (手枪射击许可 && _parent.手枪.value.shot >= 弹夹容量)
{
	手枪射击许可 = false;
	手枪换弹();
}

if (手枪2射击许可 && _parent.手枪2.value.shot >= 弹夹容量_2)
{
	手枪2射击许可 = false;
	手枪2换弹();
}

onClipEvent (load) {
    // 初始化帧计数器
    当前已持续帧1 = _parent.手枪射击间隔帧;
    当前已持续帧2 = _parent.手枪射击间隔帧_2;

    // 初始化攻击点绑定（手枪1绑定攻击点1，手枪2绑定攻击点2）
    绑定攻击点1 = _parent.攻击点1;
    绑定攻击点2 = _parent.攻击点2;

    // 初始化射击状态标志
    手枪1已射击 = false;
    手枪2已射击 = false;
    // 换向计时器（每5帧换向一次）
    换向计时器 = 0;
    换向间隔 = 5;
}
onClipEvent (unload) {
    if(_parent.子弹种类.indexOf("纵向")> -1 && _parent.原始霰弹值){
		_parent._parent.手枪.value.shot *= _parent.霰弹值/_parent.原始霰弹值;
	}
    if(_parent.子弹种类_2.indexOf("纵向")> -1 && _parent.原始霰弹值_2){
		_parent._parent.手枪2.value.shot *= _parent.霰弹值_2/_parent.原始霰弹值_2;
	}
}

onClipEvent (enterFrame) {
    // 更新帧计数器
    当前已持续帧1++;
    当前已持续帧2++;
    换向计时器++;
    if (换向计时器 >= 换向间隔) {
        // 交换攻击点绑定
        if (手枪1已射击) {
            绑定攻击点1 =  绑定攻击点1 == _parent.攻击点1? _parent.攻击点2:_parent.攻击点1;
            手枪1已射击 = false;
        }
        if (手枪2已射击) {
            绑定攻击点2 =  绑定攻击点2 == _parent.攻击点1? _parent.攻击点2:_parent.攻击点1;
            手枪2已射击 = false;
        }

        换向计时器 = 0;
    }

    // ========== 手枪1射击逻辑 ==========
    if (_parent.手枪射击许可 && 
        当前已持续帧1 >= _parent.手枪射击间隔帧 && 
        _parent._parent.手枪.value.shot < _parent.弹夹容量) {

        _parent._parent.手枪.value.shot ++;

        // 检查换弹
        if (_parent._parent.手枪.value.shot >= _parent.弹夹容量) {
            _parent.手枪换弹();
